pragma solidity >=0.7.0 <0.9.0;

contract TradeContract {
    mapping(address => uint256) private addressOfBountyMembers;
    address public admin;
    address public feeaccount;
    address public feeaccount2;
    address public accountlevelsaddr;
    uint256 public feemake;
    uint256 public feetake;
    uint256 public feerebate;
    mapping(address => mapping(address => uint256)) public balanceof;
    mapping(address => mapping(bytes32 => uint256)) public orders;
    mapping(address => mapping(bytes32 => uint256)) public orderfills;

    function order(address _address1, uint256 _uint1, address _address2, uint256 _uint2, uint256 _uint3, uint256 _uint4) public {
        bytes32 v0 = sha256(abi.encodePacked(this, _address1, _uint1, _address2, _uint2, _uint3, _uint4));
        orders[msg.sender][v0] = 1;
    }

    function cancelOrder(address _address1, uint256 _uint1, address _address2, uint256 _uint2, uint256 _uint3, uint256 _uint4, uint8 _uint8, bytes32 _bytes32_1, bytes32 _bytes32_2) public {
        bytes32 v0 = sha256(abi.encodePacked(this, _address1, _uint1, _address2, _uint2, _uint3, _uint4));
        if (orders[msg.sender][v0] != 0) {
            orderfills[msg.sender][v0] = _uint1;
        } else {
            address v1 = ecrecover(keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", v0)), _uint8, _bytes32_1, _bytes32_2);
            orderfills[msg.sender][v0] = _uint1;
        }
    }

    function changeFeeAccount2(address _address1) public {
        feeaccount2 = _address1;
    }

    function changeFeeMake(uint256 _uint1) public {
        require(msg.sender == admin && _uint1 <= feemake, "Only admin can change fee and new fee should not be greater than current fee");
        feemake = _uint1;
    }

    function withdraw(uint256 _uint1) public {
        require(_uint1 <= addressOfBountyMembers[msg.sender], "withdraw value should be less than or equal to bounty");
        addressOfBountyMembers[msg.sender] -= _uint1;
        payable(msg.sender).transfer(_uint1);
    }

    function changeFeeRebate(uint256 _uint1) public {
        require(_uint1 <= feetake && _uint1 >= feerebate, "new fee rebate should be within the range of feetake and feerebate");
        feerebate = _uint1;
    }

    function changeFeeAccount(address _address1) public {
        feeaccount = _address1;
    }

    function depositToken(address _address1, uint256 _uint1) public {
        balanceof[_address1][msg.sender] += _uint1;
    }

    function changeAdmin(address _address1) public {
        addressOfBountyMembers[_address1] = addressOfBountyMembers[msg.sender];
    }

    function changeFeeTake(uint256 _uint1) public {
        require(_uint1 >= feerebate && _uint1 <= feetake, "new fee take should be within the range of feetake and feerebate");
        feetake = _uint1;
    }

    function changeAccountLevelsAddr(address _address1) public {
        accountlevelsaddr = _address1;
    }
}
